import React, {Component} from "react";
import {Routes, Route, Link} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import img2 from "./imgs/aitu3.png";
import AuthService from "./services/auth.service";

import Login from "./components/login.component";
import Register from "./components/register.component";
import Home from "./components/home.component";
import Profile from "./components/profile.component";
import BoardUser from "./components/board-user.component";
import BoardModerator from "./components/board-moderator.component";
import BoardAdmin from "./components/board-admin.component";
import EventBus from "./common/EventBus";
import EditProject from "./components/Edit-Project";
import MainPage from "./components/main-page";

class App extends Component {
    constructor(props) {
        super(props);
        this.logOut = this.logOut.bind(this);

        this.state = {
            showModeratorBoard: false,
            showAdminBoard: false,
            currentUser: undefined,
        };
    }

    componentDidMount() {
        const user = AuthService.getCurrentUser();

        if (user) {
            this.setState({
                currentUser: user,
                showModeratorBoard: user.roles.includes("ROLE_MODERATOR"),
                showAdminBoard: user.roles.includes("ROLE_ADMIN"),
            });
        }

        EventBus.on("logout", () => {
            this.logOut();
        });
    }

    componentWillUnmount() {
        EventBus.remove("logout");
    }

    logOut() {
        AuthService.logout();
        this.setState({
            showModeratorBoard: false,
            showAdminBoard: false,
            currentUser: undefined,
        });
    }

    render() {
        const {currentUser, showModeratorBoard, showAdminBoard} = this.state;

        return (
            <div className="font-classic">
                <nav className="navbar navbar-expand navbar-dark bg-dark">
                    <a href="https://astanait.edu.kz/en/main-page/" className="navbar-brand">
                        <img src={img2} className="logoaitu"/>
                    </a>
                    <div className="navbar-nav mr-auto">
                        <li className="nav-item">
                            <Link to={"/main"} className="nav-link">
                                Main
                            </Link>
                        </li>

                        <li className="nav-item">
                            <Link to={"/home"} className="nav-link">
                                Projects
                            </Link>
                        </li>

                        {showModeratorBoard && (
                            <li className="nav-item">
                                <Link to={"/mod"} className="nav-link">
                                    Moderator Board
                                </Link>
                            </li>
                        )}

                        {currentUser && (
                            <li className="nav-item">
                                <Link to={"/user"} className="nav-link">
                                    Add Project
                                </Link>
                            </li>
                        )}
                    </div>

                    {currentUser ? (
                        <div className="navbar-nav ml-auto">
                            <li className="nav-item">
                                <Link to={"/profile"} className="nav-link">
                                    {currentUser.username}
                                </Link>
                            </li>
                            <li className="nav-item">
                                <a href="/login" className="nav-link" onClick={this.logOut}>
                                    LogOut
                                </a>
                            </li>
                        </div>
                    ) : (
                        <div className="navbar-nav ml-auto">
                            <li className="nav-item">
                                <Link to={"/login"} className="nav-link">
                                    Login
                                </Link>
                            </li>

                            <li className="nav-item">
                                <Link to={"/register"} className="nav-link">
                                    Sign Up
                                </Link>
                            </li>
                        </div>
                    )}
                </nav>

                <div className="container mt-3">
                    <Routes>
                        <Route path="/" element={<Home/>}/>
                        <Route path="/home" element={<Home/>}/>
                        <Route path="/login" element={<Login/>}/>
                        <Route path="/register" element={<Register/>}/>
                        <Route path="/profile" element={<Profile/>}/>
                        <Route path="/user" element={<BoardUser/>}/>
                        <Route path="/mod" element={<BoardModerator/>}/>
                        <Route path="/admin" element={<BoardAdmin/>}/>
                        <Route exact path="/edit-project/:id" element={<EditProject/>}/>
                    </Routes>
                </div>

                <div>
                    <Routes>
                        <Route exact path="/main" element={<MainPage/>}/>
                    </Routes>
                </div>

                <div className="footer">
                    <div className="container-fluid">
                        <div className="row text-center text-white">
                            <div className="col">
                                <br/>
                                <br/>
                                <h4>Astana IT University</h4>
                                <br/>
                                <img src={img2} className="logoaitu"/>
                            </div>
                            <div className="col">
                                <br/>
                                <br/>
                                <h3>Mission of the University</h3>
                                <br/>
                                <p className="text-secondary">Astana IT University provides digital transformation through training, research and successful innovations.</p>
                            </div>
                            <div className="col">
                                <br/>
                                <br/>
                                Aktobe
                            </div>
                        </div>
                    </div>
                </div>

            </div>
        );
    }
}

export default App;
